import React from "react";
import fetch from "./Fetches";

class App extends React.Component {
  componentDidMount() {
    this.fetchData();
  }
  fetchData = async () => {
    let a = await fetch();
    await console.log(typeof a);
  };
  render() {
    return <div>HI</div>;
  }
}

export default App;
